    /// <summary>
    /// Creates a randomized XML file.
    /// </summary>
    /// <param name="depth">Number of inner loops.</param>
    public static string GenerateRandomXml(int depth)
    {
        var sb = new StringBuilder();
        sb.AppendLine("<Root>");
        for (var i = 0; i < depth; i++)
        {
            sb.Append('\t', i);
            sb.AppendLine($"<Tag{i}>");
        }

        for (var i = depth - 1; i >= 0; i--)
        {
            sb.Append('\t', i);
            sb.AppendLine($"</Tag{i}>");
        }

        sb.AppendLine("</Root>");
        return sb.ToString();
    }
}